        # Optimal solution 

        max_l = 0
        hashdict = {}
        start = 0
        max_freq = 0
        for end in range(len(s)):
            hashdict[s[end]] = hashdict.get(s[end], 0) + 1

            max_freq = max(max_freq, hashdict[s[end]])

            if end + 1 - start - max_freq > k:
                hashdict[s[start]] -= 1
                start += 1

            max_l = end + 1 - start

        return max_l




